/**
 * @param {number[]} nums
 * @param {number} k
 * @return {number}
 */
var maxSum = function(nums, k) {
    nums.sort((a, b) => b - a);
    let sum = 0;
    const mod = 1e9 + 7;
    for (let i = 0; i < k; i++) {
        sum = (sum + BigInt(nums[i]) * BigInt(nums[i])) % BigInt(mod);
    }
    return Number(sum);
};
